INSERT INTO `blogs` VALUES (35,112,'assets-for-unreal-engine','{\"keywords\": \"\", \"description\": \"\"}','Assets for Unreal Engine','start unreal engine','<h1>Hey! We are glad to present the marketplace of assets for Unreal Engine.</h1>\n<p><img src=\"/../../../../../../storage/app/public/articles-photos/user-112/1624859159.jpeg\" alt=\"\" width=\"1880\" height=\"1251\" /></p>',0,1,0,0,1,'2021-06-24 20:06:32','2021-11-29 22:08:18'),(36,112,'unreal-engine---is-this-the-future-of-the-archvis','{\"keywords\": \"\", \"description\": \"\"}','Unreal Engine - is this the future of the archvis?','Unreal engine 5 architecture visualisation','<h3>Facts and my reasoning</h3>\n<p><br />Hi, guys! The use of the engine in architectural visualization has not been a sensation. In this article I want to share my opinion.</p>\n<p>Several videos for those who have not seen</p>\n<p><iframe src=\"https://www.youtube.com/embed/9fC20NWhx4s\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p><iframe src=\"https://player.vimeo.com/video/430044693?title=0&amp;byline=0&amp;portrait=0&amp;color=8dc7dc\" width=\"425\" height=\"350\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p><iframe src=\"https://www.youtube.com/embed/S-qY2nC-fac\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>The long-awaited fifth version has recently been released.</p>\n<p><iframe src=\"https://www.youtube.com/embed/d1ZnM7CH-v4\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<h3>&nbsp;</h3>\n<h3>Will Unreal Engine supersede classic renders?</h3>\n<p><br />My answer is no, at least for the next few years. The release of powerful video cards not only helps the engine to develop, but also has a good effect on renders such as Fstorm, Octane, RedShift.</p>\n<p>And if necessary, the transition to Unreal Engine for experienced professionals does not take much time.</p>\n<p>The engine is interesting as an interactive tool and the ability to create animations without rendering farms.</p>\n<p>But even for static renders, Unreal engine shows good results.&nbsp;</p>\n<p>&nbsp;</p>\n<h3>How it works?</h3>\n<p><br />There are many plugins and scripts that make transfer geometry with auto-unwraping and even materials, from TS_Tools to the official DataSmith</p>\n<p>All automatic tools do not work perfectly and can be used, but with refinement. It is best to manually optimize scenes, prepare unwrap, and use your material library. This allows you to control all stages of work.</p>\n<p>My result using DataSmith and RTX versus animation in Corona. Transferring a scene from 3dmax and preparing for animation in Unreal Engine takes a couple of hours.</p>\n<p><iframe src=\"https://www.youtube.com/embed/WkAASsHN4eA\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>&nbsp;</p>\n<p>And in this video I showed the whole process of converting the scene, finalizing the materials and creating the light.</p>\n<p><iframe src=\"https://www.youtube.com/embed/D6kIXx3jgV8\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>Is the future of Unreal Engine for the archives? Definitely yes! The engine is evolving rapidly, but classic renders will not lag behind, so this tool is firmly rooted as a must-have in the arsenal of an architectural renderer.</p>\n<p>This is how I briefly told my thoughts. I hope it was interesting.</p>\n<p>In plans to continue sharing my xperience on my <a href=\"https://www.youtube.com/channel/UCWGo_qcp5IIrvAmphX4yvPw\">YouTube channel.</a></p>\n<p>All kindness, inspiration and interesting projects!</p>',0,1,0,0,0,'2021-06-28 05:40:39','2021-11-30 08:24:57'),(37,112,'challenge.-modern-interior-in-unreal-engine-for-architectural-visualization','{\"keywords\": \"\", \"description\": \"\"}','Challenge. Modern interior in Unreal Engine for architectural visualization','челендж challenge interior интериор интерьер','<h2 style=\"text-align: left;\"><img src=\"/../../../../../../../../../../../../../../storage/app/public/articles-photos/user-112/1628992944.jpg\" alt=\"\" width=\"911\" height=\"417\" /></h2>\n<div style=\"padding-left: 40px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hello. I am glad to announce the challenge from UnrealShop and invite all fans of Unreal Engine to take part in the competition. Submit your Interiors. The style of your interiors should be contemporary. Just upload your work. Details about the challenge here <a href=\"../challenge/modern-minimalistic-interior\">https://unreal.shop/challenge/modern-minimalistic-interior</a></div>\n<div style=\"padding-left: 40px;\">&nbsp;</div>\n<div style=\"padding-left: 40px;\"><strong>Here is the challenge gallery <a href=\"../challenge/modern-minimalistic-interior/cards\">https://unreal.shop/challenge/modern-minimalistic-interior/cards</a></strong></div>\n<div style=\"padding-left: 40px;\">&nbsp;</div>\n<div style=\"text-align: left; padding-left: 40px;\"><strong>The works will be evaluated according to three criteria, on a ten-point scale:</strong></div>\n<div style=\"text-align: left;\">&nbsp;</div>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>Realism</li>\n<li style=\"text-align: left;\">Artistry</li>\n<li>Originality</li>\n</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<div style=\"padding-left: 80px;\"><strong>We will pick three winners, which will receive prizes. </strong></div>\n<div style=\"padding-left: 80px;\"><strong>The prizes will be distributed like this:</strong></div>\n<div style=\"padding-left: 40px;\">&nbsp;</div>\n<div style=\"padding-left: 120px;\">The 1st winner&nbsp; <strong>400 USD</strong><br />The 2nd winner <strong>200 USD</strong><br />The 3rd winner&nbsp; <strong>100 USD</strong></div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"text-align: left; padding-left: 40px;\"><strong>Jury Challenge</strong></p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../storage/app/public/articles-photos/user-112/1628046824.jpg\" alt=\"\" width=\"286\" height=\"380\" /></strong></p>\n<p style=\"text-align: center;\"><strong>Jamie Holmes</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<div style=\"text-align: left; padding-left: 120px;\">Based in New Zealand Jamie Holmes is an award winning artist and co-founder of Architecture visualization company One to&nbsp;One Hundred and Creative agency Oneforall. While studying to become an architect Jamie found a passion in 3D rendering.&nbsp; Combining in-depth knowledge of design and the building process to create beautiful imagery.An area of interest for Jamie is large environment scenes where exploration of the macro and the micro come together to create technical problems to solve. Jamie is Inspired by nature and fine architecture and objects by many past and current designers on a journey to one day move from the digital to physical.</div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../storage/app/public/articles-photos/user-112/1627882650.\" alt=\"\" width=\"325\" height=\"298\" /></p>\n<p style=\"text-align: center;\"><strong>Vital</strong><strong>y Chubko</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<div style=\"padding-left: 120px;\">Сofounder of the hasten.me studio, a service for virtual staging, architectural visualization and 3D tours using a matterport camera. The studio is mainly working in the USA, the main market is New York</div>\n<div style=\"padding-left: 120px;\">&nbsp;</div>\n<div style=\"padding-left: 120px;\">&nbsp;</div>\n<div style=\"padding-left: 120px;\">&nbsp;</div>\n<div>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../storage/app/public/articles-photos/user-112/1628990928.jpg\" alt=\"\" width=\"322\" height=\"483\" /></p>\n<p style=\"text-align: center;\"><strong>Andrei Dolnikov</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<div style=\"padding-left: 120px;\">\n<div class=\"msg-s-event-listitem\n    \n    \n    \n    \n    \n    \n     msg-s-event-listitem--other\n    \n    \n    \" data-event-urn=\"urn:li:fs_event:(2-NmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==,2-MTYyODk0OTkyNzQ3NmI3Nzk5NC0wMDEmNmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==)\">\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">Andrei Dolnikov is an Interior Architect and Founder of BINYAN - a leading Architectural 3D Rendering &amp; Animation Studio specialising in the creation of bespoke, considered and memorable architectural films &amp; images. He started the business in his Sydney living room after working as a visualiser in the U.S. and has since guided Binyan to its place as a leader in the field. The team of 100+ artists and producers are currently working on projects all over the globe from its 5 studios in Sydney, Melbourne, New York and London. Binyan is focused on driving the Arch Viz Industry into the next phase of its development by engaging with the wider educational and artist community to bring our industry to greater recognition. Collaboration has always been a key Binyan trait and Andrei has built a team of world-class artists who work together to bring originality and sophistication to their clients&rsquo; projects. Andrei is passionate about giving back to the community and is a Rabbi in his local synagogue &ndash; he lives in Melbourne with his wife and four beautiful children&hellip; and his tenor sax</div>\n</div>\n</div>\n</div>\n<div style=\"padding-left: 120px;\">&nbsp;</div>\n<div style=\"padding-left: 120px;\">&nbsp;</div>\n<div>&nbsp;</div>\n<div>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../storage/app/public/articles-photos/user-112/1628992825.\" alt=\"\" width=\"317\" height=\"428\" /></p>\n<p style=\"text-align: center;\"><strong>Slava Oganesian</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<div style=\"padding-left: 120px;\">\n<div class=\"msg-s-event-listitem\n    \n    \n    \n    \n    \n    \n     msg-s-event-listitem--other\n    \n    \n    \" data-event-urn=\"urn:li:fs_event:(2-NmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==,2-MTYyODk0OTkyNzQ3NmI3Nzk5NC0wMDEmNmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==)\">\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">CEO &amp; Co-founder at LUNAS</div>\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">&nbsp;</div>\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">&nbsp;</div>\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">&nbsp;</div>\n</div>\n</div>\n</div>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../storage/app/public/articles-photos/user-112/1628993167.\" alt=\"\" width=\"314\" height=\"444\" /></p>\n<p style=\"text-align: center;\"><strong>Stanislav Kozlovskii</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<div style=\"padding-left: 120px;\">\n<div class=\"msg-s-event-listitem\n    \n    \n    \n    \n    \n    \n     msg-s-event-listitem--other\n    \n    \n    \" data-event-urn=\"urn:li:fs_event:(2-NmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==,2-MTYyODk0OTkyNzQ3NmI3Nzk5NC0wMDEmNmY3ZTQ1YTYtYjMwMi00NDEwLThkZjQtODdkODAxZDFjODU5XzAxMA==)\">\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">3D artist based in Auckland, New Zealand. Specialise on commercial architectural visualisation.<br />Make still images, animation and interactive tours.</div>\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">An authorised Autodesk trainer.<br />Founder ARHI.TEACH - 3D school and Unreal.Shop - Unreal Engine Marketplace</div>\n<div class=\"msg-s-event-listitem__message-bubble msg-s-event-listitem__message-bubble--msg-fwd-enabled\">&nbsp;</div>\n</div>\n</div>',0,1,0,0,0,'2021-07-29 20:47:49','2021-12-22 02:27:51'),(39,112,'test1','{\"keywords\": \"\", \"description\": \"\"}','Test1','Chair, living room','<p>test1</p>',0,0,0,0,0,'2021-11-29 22:08:45','2021-11-29 22:13:04'),(40,112,'test2','{\"keywords\": \"\", \"description\": \"\"}','test2','test2','<p>test2</p>',0,0,0,0,1,'2021-11-29 22:09:57','2021-11-29 22:13:04');
